import React from 'react';

import Link from 'next/link';

import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';

import Query from './query';
import SECTIONS_QUERY from '../apollo/queries/sections/sections';


const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
    },
    menuButton: {
        marginRight: theme.spacing(2),
    },
    title: {
        flexGrow: 1,
    },
}));

export default props => {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <AppBar position="static">
                <Toolbar>
                    <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
                        <MenuIcon />
                    </IconButton>
                    <Query query={SECTIONS_QUERY}>
                        {({ data: { sections } }) => {
                            return <Sections data={sections} />
                        }}
                    </Query>
                    <Button color="inherit">Login</Button>
                </Toolbar>
            </AppBar>
        </div>
    );
}

const Sections = props => {
    const classes = useStyles();

    return (
        <>
            {props.data.map(section =>
                <Link href={"/" + section.title.toLower() } key={section.title + "NextLink"}>
                    <a key={section.title + "Link"}>
                        <Typography variant="body2" className={classes.title} key={section.title}>
                            {section.title}
                        </Typography>
                    </a>
                </Link>
            )}
        </>
    );
}
